import React from 'react';

import PropTypes from 'prop-types';

const Input = () => (
  <input type={this.props.type} placeholder={this} required />
);

Input.propTypes = {
  type: PropTypes.string.isRequired,
  placeholder: PropTypes.string.isRequired,
};

export default Input;
